import React from "react"; 
import {Container, Image} from "react-bootstrap";
import CardBack from "./back.png"

const Back = (props) => {

    return(
        <Container>
        <Image fluid>
        <img src = {CardBack}/> 
        </Image> 
        </Container>
    )
}

export default Back;
